In this video we explain how to start a phone flipping business and scale to $100K a year using various different methods we have both learned over the years.

@julia_aless is a full time millennial entrepreneur running multiple businesses working from home. She is a mother, wife, and a daughter. She has taught thousands of people how to make money using recession proof methods. Her main stream that got her started is phone flipping, which to continues to do to this day and teaches people how to do the same thing.

@nycphonebuyer aka Fel the don is also a millennial entrepreneur born and raised in New York City (that’s me guys!) I run iPhone repair academy where you guys learn how to launch, grow, and scale a successful phone repair business.

We will be dropping more live videos like this for you guys to ensure that you get all the gems and knowledge that you need to side hustle your way to financial freedom.

